import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { UserContextProvider } from './context/UsersContext'; // UsersContextProvider'ı import edin

// pages & components
import Home from './pages/HomePage';
import AdminPage from './pages/AdminPage';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <div className="pages">
          <Routes>
            <Route
              path="/"
              element={<Home />}
            />
            <Route
              path="/admin"
              element={
                <UserContextProvider>
                  <AdminPage />
                </UserContextProvider>
              }
            />
          </Routes>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
